import React from 'react';
import {BrowserRouter,NavLink} from 'react-router-dom'



const Child = (props) => (
  <div className='modal'>
    <ul>
      {
        props.val.map((temp, index) => <li> 
            <BrowserRouter>
              <div>

              </div>
            </BrowserRouter>
          </li>)
      }
    </ul>
  </div>
)


class TestToBeGiven extends React.Component {

  state={
    flag: true,
    quiztopic:[
        {topic:"HTML" ,
        route:"/html"    },
        {topic:"CSS",
        route:"/css"},       
        {topic:"JAVASCRIPT",
        route:"/javascript"},
        {topic:"REACT",
        route:"/react"},
      ]


  }

  render() {

    return (
      <div>
        <BrowserRouter>
        <div>
          <NavLink to="/"> JavaScript</NavLink> <br/>
          {!this.state.flag && <Child/>}
          <NavLink to="/"> react</NavLink>
          </div>
        </BrowserRouter>
      </div>
    );
  }
}



export default TestToBeGiven;
